import {Component} from 'react'
import API from '../api/axios'

class Index extends Component{

    async componentDidMount() {
        try {
            const result = await Api.get(`/user/me`)
            console.log(result)
        } catch (e){
            console.log(e)
        }
    }

    render() {

        return(

            <div style={{flex: 1, display:"flex"}}>

                Home

            </div>

        )
    }
} 

export default Index;
